import styled from "styled-components";

export const StyledButton = styled.button`
  padding: 10px;
  font-size: 1em;
  color: #fff;
  background-color: #ff6f61;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  &:hover {
    background-color: #e63946;
  }
`;
